import React from "react";
import { Card } from "../../UI/Card.styled";
import Headlines from "../../UI/Headlines";
const SectionFour = () => {
  const HeadlineProps = {
    height: "4rem",
    h1: {
      fontsize: "1.5rem",
      text: "What",
      color: "#5A5A5A",
    },
    h2: {
      fontsize: "2rem",
      text: "Our Users Say",
      color: "black",
    },
    icons: [UI.NextArrow, UI.PreviousArrow],
  };
  return (
    <>
      <Card
        mg={"2rem 2rem"}
        dp={"grid"}
        gridR={"25% 75%"}
        bd={"1px solid red"}
        height={"24rem"}
      >
        <Headlines Headlines={HeadlineProps} />
      </Card>
    </>
  );
};

export default SectionFour;
